import React, { useState } from "react";

const App = () => {
  const [value, setValue] = useState();
  const apiCall = async () => {
    const res = await fetch("/test");
    const body = await res.json();
    setValue(body.test);
  };
  return (
    <div>
      <div className="nav"></div>
    </div>
  );
};

export default App;
